al formation due to localized increase of vascular permeability. The causative mechanism may be allergy, infection, or stress.','en',1,'2007-10-18 04:28:24',1,'2017-04-24 14:48:19','2898FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(2993,111633,'Infections affecting those structures of the body which participate in the secretion and elimination of urine, i.e., the kidney, the ureters, the urinary bladder, and the urethra.','en',1,'2007-11-02 20:12:25',1,'2020-04-23 20:35:07','2993FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3280,112287,'A chronic infection of the conjunctiva and cornea caused by CHLAMYDIA TRACHOMATIS.','en',1,'2007-10-18 04:28:24',1,NULL,'3280FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3368,112561,'Traumatic injuries involving the cranium and intracranial structures (i.e., BRAIN; CRANIAL NERVES; MENINGES; and other structures). Injuries may be classified by whether or not the skull is penetrated (i.e., penetrating vs. nonpenetrating) or whether there is an associated hemorrhage.','en',1,'2007-10-18 04:28:24',1,NULL,'3368FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3499,112989,'A pathological condition that can suddenly affect the hemodynamic equilibrium, usually manifested by failure to perfuse or oxygenate vital organs.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 21:11:25','3499FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3500,112992,'Diseases due to or propagated by sexual contact.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 03:05:27','3500FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3599,113230,'The most important manifestation of and sequel to rheumatic fever, i.e., any cardiac involvement in rheumatic fever. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'3599FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3854,113881,'Anxiety disorders manifested by the development of characteristic symptoms following a psychologically traumatic event that is outside the normal range of usual human experience. Symptoms include re-experiencing the traumatic event and numbing of responsiveness to or reduced involvement with the external world.','en',1,'2007-10-18 04:28:24',1,'2020-04-23 18:20:56','3854FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3911,114100,'Inflammation of the lungs.','en',1,'2007-11-02 20:06:58',1,'2020-08-17 01:46:15','3911FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3941,114174,'Inflammation of a vein associated with thrombus formation.','en',1,'2007-10-18 04:28:24',1,NULL,'3941FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4485,115797,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,'2020-05-07 15:28:29','4485FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4501,115835,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-11-02 20:02:40',1,'2020-04-25 02:08:21','4501FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4639,116128,'A protozoan disease caused by four species of the genus PLASMODIUM (P. falciparum (MALARIA, FALCIPARUM), P. vivax (MALARIA, VIVAX), P. ovale, and P. malariae) and transmitted by the bite of an infected female mosquito of the genus Anopheles. Malaria is endemic in parts of Asia, Africa, Central and South America, Oceania, and certain Caribbean islands. It is characterized by extreme exhaustion associated with paroxysms of high fever, sweating, shaking chills, and anemia.','en',1,'2007-11-02 19:28:08',1,'2020-09-25 01:49:47','4639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4676,116214,'Abnormally low blood pressure seen in shock but not necessarily indicative of it. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'4676FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4719,116376,'A sudden, nonconvulsive loss of neurologic function due to an ischemic or hemorrhagic intracranial vascular event. In general, cerebrovascular accidents are classified by anatomic location in the brain, vascular distribution, etiology, age of the affected individual, and hemorrhagic vs. nonhemorrhagic nature. (From Adams et al., Principles of Neurology, 6th ed, pp777-810)','en',1,'2007-10-18 04:28:24',1,NULL,'4719FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4745,116474,'The lack of sufficient energy or protein to meet the body\'s metabolic demands, as a result of either an inadequate dietary intake of protein, intake of poor quality dietary protein, increased demands due to disease, or increased nutrient losses.','en',1,'2007-10-18 04:28:24',1,'2014-10-03 17:17:41','4745FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4775,116543,'Injuries to tissues caused by contact with heat, steam, chemicals (BURNS, CHEMICAL), electricity (BURNS, ELECTRIC), or the like.','en',1,'2007-10-18 04:28:24',1,NULL,'4775FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4831,116700,'Infestation with parasitic worms of the helminth class.','en',1,'2007-10-18 04:28:24',1,NULL,'4831FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4929,117146,'Infections in birds and mammals produced by various species of Trichomonas.','en',1,'2007-10-18 04:28:24',1,'2014-10-03 17:21:26','4929FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4933,117152,'SCHISTOSOMIASE','fr',1,'2007-09-06 09:05:28',1,NULL,'4933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4978,117315,'The condition that results from excessive loss of body water.','en',1,'2007-10-18 04:28:24',1,NULL,'4978FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5005,117386,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'5005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5011,117399,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,'2015-11-03 02:49:23','5011FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5205,117829,'Herpes simplex of the genitals.','en',1,'2007-10-18 04:28:24',1,NULL,'5205FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5228,117889,'Inflammation of the lining of the stomach and intestines, often accompanied by diarrhea.','en',1,'2007-11-02 20:20:58',1,'2016-05-25 20:46:33','5228FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5445,118652,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'5445FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5495,118789,'Difficulty in swallowing.','en',1,'2007-11-02 20:15:17',1,'2015-12-31 16:53:40','5495FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5600,119112,'Diseases of the central and peripheral nervous system. This includes disorders of the brain, spinal cord, cranial nerves, peripheral nerves, nerve roots, autonomic nervous system, neuromuscular junction, and muscle.','en',1,'2007-10-18 04:28:24',1,'2020-05-03 01:27:52','5600FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5623,119204,'The state of the body in relation to the intake and excretion of water and electrolytes, particularly sodium and potassium. It exists in a metabolic balance internally with BODY FLUID COMPARTMENTS, total BODY WATER, BLOOD VOLUME, EXTRACELLULAR SPACE, etc., externally through sensible and insensible SWEATING. The hypothalamus controls water balance. (Dorland, 27th ed; Mountcastle, Medical Physiology, 14th ed, 1980, p1152)','en',1,'2007-10-18 04:28:24',1,NULL,'5623FFFFFFFFFFFFFFFFFFFFFF