 id=\"8\" retired=\"false\">\n          <name>List of New Patient Registrations</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT pi.identifier as OpenMRS_ID, pn.given_name as Given_Name, pn.family_name as Family_Name, p.date_created as Created FROM patient p INNER JOIN person_name pn ON p.patient_id = pn.person_id INNER JOIN patient_identifier pi ON p.patient_id = pi.patient_id WHERE p.date_created &gt;= :startDate GROUP BY pi.patient_id ORDER BY p.patient_id desc;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2022-04-30 16:40:09',2,NULL,NULL,0,NULL,NULL,NULL,'e451a9d6-4881-11e7-a919-92ebcb67fe33'),(7,'Number of All Discharges','Number of All Discharges for a given location','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d1a00e10-cecb-4775-8c4f-2ed0b059d7b9\" retired=\"false\">\n  <name>Number of All Discharges</name>\n  <description>Number of All Discharges for a given location</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-04-30 16:40:09 UTC</dateCreated>\n  <parameters id=\"4\"/>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"5\">\n    <entry>\n      <string>All Discharges Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"6\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"7\" retired=\"false